      svgDim: { width: '2265px' }
    }
  },
  computed: {
    windowWidth() {
      if (typeof window !== 'undefined') {
        return window.innerWidth
      }
      return 600
    }
  },
  mounted() {
    this.svgDim = {
      width: this.$refs.svg.getBoundingClientRect().width + 'px'
    }
    this.sb = new ScrollBooster({
      viewport: this.$refs.view,
      content: this.$refs.content,
      direction: 'horizontal',
      scrollMode: 'native'
    })
  },
  methods: {}
}
</script>

